import Pokemon from "./Pokemon";

const PokeList = (props) => {
  const item = props.data.map((dataItem, id) => {
    return (
      <li key={id}>
        <Pokemon dataItem={dataItem} />
      </li>
    );
  });
  return <ul>{item}</ul>;
};
export default PokeList;
